import React from "react";
import {cities} from "../constants";

function NavBar(){

    return (
        <div>
         <button>{"<<"}</button>
         {cities.map((_,index)=>(<p>{}</p>))}
         <button>{">>"}</button>
        </div>
    );

}
export default NavBar;
